window.bookSummaryJSON = "<p>A curse to break.</p> <p>A crown to take.</p> <p>A malignant blight ravages Tearmann, wreaking havoc on the lives of the Danú. If Tadhg and Keelynn cannot find a way to stop it before it reaches the castle, there won’t be anything left for them to save.</p> <p>While the blight rages on, Aveen and Rían face troubles of their own. Between confronting ghosts from the past and fending off the Phantom Queen’s thirst for vengeance, peace and happiness seem too far out of reach.</p> <p>It isn’t a matter of if the Princes of Tearmann will fall, but when.</p> <p>Because the Queen is coming for them all… And the cost of crossing her may finally be too high to pay.</p> <p>A Cursed Love is the final book in the Myths of Airren series, following the events of A Cursed Kiss and A Cursed Heart, as told by Tadhg, Rían, Aveen, and Keelynn.</p>"; 
